#	CHECK INPUT AS STRING
check_str_input() {
	local	res=$(./push_swap "$1" 2>&1)
	if [ "$res" == "$2" ]
	then
		echo -en "$GREEN\xE2\x9C\x94$RESET"
	else
		echo -e "$RED\xE2\x9D\x8C$RESET"
		echo -e "\n${RED}INPUT: \"$1\"\nShould display: \"$2\".\nBut display: \"$res\"${RESET}"
	fi
}

#	CHECK INPUT
check_input() {
	local	res=$(./push_swap $1 2>&1)
	if [ "$res" == "$2" ]
	then
		echo -en "$GREEN\xE2\x9C\x94$RESET"
	else
		echo -e "$RED\xE2\x9D\x8C$RESET"
		echo -e "\n${RED}INPUT: \"$1\"\nShould display: \"$2\".\nBut display: \"$res\"${RESET}"
	fi
}

#	CHECK INPUT AS STRING
check_wc() {
	local	res=$(./push_swap "$1" | wc -l | tr -d ' ')
	if [ "$res" -le "$2" ]
	then
		echo -en "$GREEN\xE2\x9C\x94$RESET"
	else
		echo -e "$RED\xE2\x9D\x8C$RESET"
		echo -e "\n${RED}Word's count should be <= \"$2\".\nBut display: \"$res\"${RESET}"
	fi
}

