ft_check_arr() {
	local	max=0
	local	count=0
	local	sum=0
	for i in "${array[@]}"
	do
		#echo "array[] = $i"
		res=$(./push_swap $i | ./checker_Mac $i)
		op=$(./push_swap $i | wc -l | tr -d ' ')
		if [ "$res" == "OK" ]
		then
			echo -e "[$i] ${GREEN} $res ${RESET} : $op"
		else
			echo -e "${RED}[$i] ${YELLOW} $res ${RED} : $op${RESET}"
		fi

		if [ $op -gt $max ]
		then
			max=$op
		fi
		((sum=sum+op))
		((count++))
	done
	echo -e "\n${PURPLE}----------\nCOUNT: $count\n  MAX: $max\n MEAN: $(($sum/$count))${RESET}"
}

