max=0
count=0
sum=0
for i in "${array[@]}"
do
	#echo "array[] = $i"
	res=$(./push_swap $i | ./checker_Mac $i)
	op=$(./push_swap $i | wc -l | tr -d " ")
	if [ "$res" == "OK" ]
	then
		echo -e "${GREEN} $res ${RESET} : $op"
	else
		echo -e "${RED}${YELLOW} $res ${RED} : $op${RESET}"
	fi

	if [ $op -gt $max ]
	then
		max=$op
	fi
	((sum=sum+op))
	((count++))
done
echo -e "${PURPLE}----------\nCOUNT: $count\n  MAX: $max\n MEAN: $(($sum/$count))${RESET}"
